ion -->\n					<md-list>\n						<md-list-item ng-repeat="notice in vm.notifications" ng-style="notice.unread && {\'background-color\':\'#E9F3FF\'}" ng-click="vm.onClickNotification(notice)">\n							<!-- user avatar -->\n							<img flex style="max-height:50px; max-width:50px;" ng-src="{{ notice.user.photo_path }}" />\n							<!-- notification text -->\n							<div offset="5" flex>\n								<p class="md-body-2 note">{{notice.content}}</p>\n								<p class="md-caption note" style="color: #BCBCBC;">{{ notice.timestamp }}</p>\n							</div>\n						</md-list-item>\n					</md-list>\n					<!-- Message -->\n					<md-menu-item style="min-height: 30px; height:30px">\n						<p class="md-body-1">Message</p>\n					</md-menu-item>\n					<md-divider></md-divider>\n					<md-list>\n						<md-list-item ng-repeat="msg in vm.messages" ng-style="msg.unread && {\'background-color\':\'#E9F3FF\'}" ng-click="vm.onClickMessage(msg, $event)">\n							<!-- user avatar -->\n							<img flex style="max-height:50px; max-width:50px;" ng-src="{{ msg.user.photo_path }}" />\n							<!-- messages text -->\n							<div offset="5" flex>\n								<p class="md-body-2 note">{{msg.content}}</p>\n								<p class="md-caption note" style="color: #BCBCBC;">{{ msg.timestamp }}</p>\n							</div>\n						</md-list-item>\n					</md-list>\n					<md-divider></md-divider>\n					<md-divider></md-divider>\n					<!-- See All text -->\n					<md-menu-item style="min-height: 30px; height:30px">\n						<p class="md-body-2">全部</p>\n					</md-menu-item>\n				</md-menu-content>\n			</md-menu>\n		</div>\n		<!-- user menu div -->\n		<div flex="35" flex-md flex-sm layout="row" layout-align="center center">\n			<md-button ng-hide="vm.isLoggedIn" ng-click="vm.onLogin()">登入</md-button>\n			<md-menu flex flex-sm="70" md-offset="-10 75">\n				<md-button ng-show="vm.isLoggedIn" ng-click="$mdOpenMenu()">\n					<div ng-show="vm.isLoggedIn" layout="row" layout-align="center center">\n						<img hide-sm style="max-height:25px; max-width:2